import React, { useState, useRef } from 'react';
import './ToursSection.css';

const ToursSection = () => {
  const [activeIndex, setActiveIndex] = useState(0);
  const carouselRef = useRef(null);

  const tour = [
    {
      id: 1,
      title: "KARACHI",
      image: "https://cdn.britannica.com/85/128585-050-5A1BDD02/Karachi-Pakistan.jpg",
      category: "City",
      description: "The City of Lights awaits your next adventure!",
      price: 54,
      duration: "1h 30min",
      rating: 8.9,
      reviews: 350
    },
    {
      id: 2,
      title: "ISLAMABAD",
      image: "https://upload.wikimedia.org/wikipedia/commons/e/e7/Faisal_Mosque%2C_Islamabad.jpg",
      category: "City",
      description: "Explore the serene beauty of Pakistan’s capital!",
      price: 48,
      duration: "1h 15min",
      rating: 9.2,
      reviews: 420
    },
    {
      id: 3,
      title: "LAHORE",
      image: "https://upload.wikimedia.org/wikipedia/commons/9/9f/Badshahi_Mosque_of_Lahore.jpg",
      category: "City",
      description: "Discover the cultural heartbeat of Pakistan.",
      price: 50,
      duration: "2h 10min",
      rating: 8.7,
      reviews: 390
    },
    {
      id: 4,
      title: "SKARDU",
      image: "https://upload.wikimedia.org/wikipedia/commons/8/8b/Shangrila_Resorts_in_Skardu%2C_Pakistan.jpg",
      category: "Mountain",
      description: "Journey to the gateway of the world’s highest peaks.",
      price: 70,
      duration: "3h 20min",
      rating: 9.4,
      reviews: 280
    },
    {
      id: 5,
      title: "HUNZA",
      image: "https://upload.wikimedia.org/wikipedia/commons/1/17/Autumn_in_Hunza_Valley.jpg",
      category: "Valley",
      description: "Experience the enchanting beauty of Hunza Valley.",
      price: 65,
      duration: "3h 40min",
      rating: 9.6,
      reviews: 310
    },
    {
      id: 6,
      title: "MURREE",
      image: "https://upload.wikimedia.org/wikipedia/commons/3/32/Snowfall_in_Murree.jpg",
      category: "Hill Station",
      description: "Escape to the cool breezes of Murree.",
      price: 40,
      duration: "1h 50min",
      rating: 8.5,
      reviews: 275
    }
  ];
  

  const handlePrev = () => {
    if (activeIndex > 0) {
      setActiveIndex(activeIndex - 1);
      carouselRef.current.scrollTo({
        left: (activeIndex - 1) * 580,
        behavior: 'smooth'
      });
    }
  };

  const handleNext = () => {
    if (activeIndex < tours.length - 1) {
      setActiveIndex(activeIndex + 1);
      carouselRef.current.scrollTo({
        left: (activeIndex + 1) * 580,
        behavior: 'smooth'
      });
    }
  };

  return (
    <section className="tours_section">
      <div className="container">
        <div className="main_title">
          <h2>Pre Planned Trips</h2>
          <p>Discover the Pakistan with Ease - Pre-Planned Trips for Effortless Adventures!</p>
        </div>
        <div className="tours_carousel" ref={carouselRef}>
          {tours.map((tour, index) => (
            <div key={tour.id} className="tour_item">
              <div className="box_grid">
                <figure>
                  <img src={tour.image} alt={tour.title} />
                  <div className="read_more"><span>Read more</span></div>
                  <small>{tour.category}</small>
                </figure>
                <div className="wrapper">
                  <h3>{tour.title}</h3>
                  <p>{tour.description}</p>
                  <span className="price">From <strong>${tour.price}</strong> /per person</span>
                </div>
                <ul>
                  <li><i className="icon_clock_alt"></i> {tour.duration}</li>
                  <li><i className="icon_like"></i> {tour.rating} ({tour.reviews} reviews)</li>
                </ul>
              </div>
            </div>
          ))}
        </div>
        <div className="carousel_controls">
          <button onClick={handlePrev} className="prev">&lt;</button>
          <button onClick={handleNext} className="next">&gt;</button>
        </div>
      </div>
    </section>
  );
};

export default ToursSection;
